import React, { Component } from "react";

export default class Container extends Component {
  state = {
    books: []
  };

  componentDidMount() {
    fetch("https://api.myjson.com/bins/zyv02")
      .then(response => response.json())
      .then(data => this.books.setState(data));
  }

  render() {
    return <div></div>;
  }
}
